import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';

const API_BASE_URL = 'http://localhost:8000/api';

function App() {
  const [currentView, setCurrentView] = useState('login');
  const [user, setUser] = useState(null);

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (token) {
      // В реальном приложении здесь проверка токена
      setUser({ full_name: 'Демо пользователь' });
      setCurrentView('main');
    }
  }, []);

  const handleLogin = () => {
    const mockUser = { 
      id: 1, 
      full_name: 'Иванов Иван Иванович',
      is_superuser: false 
    };
    setUser(mockUser);
    localStorage.setItem('token', 'demo-token');
    setCurrentView('main');
  };

  const handleLogout = () => {
    setUser(null);
    localStorage.removeItem('token');
    setCurrentView('login');
  };

  return (
    <div className="App">
      {currentView === 'login' && <LoginView onLogin={handleLogin} />}
      {currentView === 'main' && user && <MainView user={user} onLogout={handleLogout} />}
    </div>
  );
}

function LoginView({ onLogin }) {
  const [formData, setFormData] = useState({ badge_id: '', password: '' });

  const handleSubmit = (e) => {
    e.preventDefault();
    onLogin();
  };

  return (
    <div className="login-container">
      <div className="login-form">
        <h2>Авторизация оператора</h2>
        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label>Badge ID:</label>
            <input
              type="text"
              value={formData.badge_id}
              onChange={(e) => setFormData({...formData, badge_id: e.target.value})}
              placeholder="Введите ваш badge ID"
            />
          </div>
          <div className="form-group">
            <label>Пароль:</label>
            <input
              type="password"
              value={formData.password}
              onChange={(e) => setFormData({...formData, password: e.target.value})}
              placeholder="Введите пароль"
            />
          </div>
          <button type="submit">Войти</button>
        </form>
        <p style={{marginTop: '1rem', color: '#666', fontSize: '14px'}}>
          Для демо введите любые данные и нажмите "Войти"
        </p>
      </div>
    </div>
  );
}

function MainView({ user, onLogout }) {
  return (
    <div className="main-container">
      <header className="header">
        <h1>Учет инструментов</h1>
        <div className="user-info">
          <span>Оператор: {user.full_name}</span>
          <button onClick={onLogout}>Выйти</button>
        </div>
      </header>
      <div className="content">
        <h2>Добро пожаловать в систему учета инструментов!</h2>
        <p>Здесь будет интерфейс для работы с инструментами.</p>
      </div>
    </div>
  );
}

export default App;
